}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16">  <polygon points="12 2 12 0 0 0 0 14 4 14 4 16 16 16 16 2 12 2" fill="#464646"/>  <rect x="5" y="3" width="10" height="12" fill="#fff"/>  <rect x="6" y="12" width="8" height="1" fill="#c8c8b9"/>  <rect x="6" y="10" width="8" height="1" fill="#c8c8b9"/>  <rect x="6" y="8" width="8" height="1" fill="#c8c8b9"/>  <rect x="6" y="6" width="8" height="1" fill="#c8c8b9"/>  <polygon points="4 2 11 2 11 1 1 1 1 13 4 13 4 2" fill="#fff"/>  <rect x="2" y="10" width="2" height="1" fill="#c8c8b9"/>  <rect x="2" y="8" width="2" height="1" fill="#c8c8b9"/>  <rect x="2" y="6" width="2" height="1" fill="#c8c8b9"/>  <rect x="2" y="4" width="2" height="1" fill="#c8c8b9"/></svg>';
